INSERT INTO `books` VALUES (1,'Shares That Grow','Shares that Grow introduces a new index for quick evaluation of relative value of investment grade quoted shares. The data that it uses is based on current media publication of ratios etc. The author is a former Chartered Accountant, Foundation Manager of the Samoa National Provident Fund and educated at Victoria University of Wellington NZ.','2024-07-19 15:30:56','Junkybooks'),(2,'Quantitative Methods In Finance','Financial  risk management is a new quantitative discipline. Its development began during the 1970s, spurred on by the first Basel Accord, between the G10 countries, which covered the regulation of banking risk. Over the past 30 years banks have begun to understand the risks they take, and substantial progress has been made, particularly in the area of market risks.','2024-07-19 15:31:29','Junkybooks'),(3,'Goliath','In 1931, during its maiden voyage, the British Airship Goliath mysteriously disappears without a trace. Hidden deep inside is a secret that could change the world.','2024-07-19 15:35:10','Richard Turner'),(4,'Induction','They weren\'t supposed to exist. Sidonie & Sinclair Boudreau were the offspring of a witch and a shifter. Such pairings usually resulted in death. Sid & Sin had not only survived, but thrived, and managed to sidestep the family legacy of supernatural policing.','2024-07-19 15:41:44','T.k. Eldridge'),(5,'The Reluctant Coroner','Blood is thicker than oil--until murder is involved. Fenway Stevenson doesn\'t want to return to the coastal town where her estranged father is practically king. But the death of her mother draws her back home--and the murder of the county coroner draws her into a deepening conspiracy. As the body count rises and all signs seem to point toward her father\'s oil company, will Fenway uncover the truth before family bonds become deadly?','2024-07-19 15:42:15','Paul Austin Ardoin'),(6,'The Fireraisers','Dundee, Scotland, 1862. After the mill of businessman Matthew Beaumont burns to the ground, Detective Sergeant George Watters is sent to investigate. Soon, George discovers that this is not the first property that has been targeted. When a man is found dead in the hold of a trade ship, George discovers a shocking connection between Beaumont and foreign powers threatening the very country.','2024-07-19 15:42:46','Malcolm Archibald'),(7,'Murder Over Easy','Murder has never been this easy When Sunny Charles arrives in small-town Parfait, Florida, the last thing she expects is a note from her aunt instructing her to take control of the famous Sunny Side Up Caf. After going through a vicious divorce, losing her entire life savings, and, oh yeah, having the Russian mob on her tail, Sunnys willing to give it a shot, even if it means trying her hand at cooking.','2024-07-19 16:29:59','Rosie A. Point'),(8,'Murder ','Paragraph on Books Are Our Best Friends in 100 Words​​ Books are the hub of all information and knowledge.','2024-07-19 16:51:10','Rosie A. Point');
